 M√≥dulos que exportam valores √∫nicos  s√£o muito populares na comunidade Node.js.
Mas eles tamb√©m s√£o comuns no desenvolvimento de frontend onde muitas vezes voc√™ tem construtores / classes para modelos, com um modelo por m√≥dulo.
Um m√≥dulo ECMAScript 6 pode escolher uma exporta√ß√£o padr√£o, o valor exportado mais importante.
As exporta√ß√µes padr√£o s√£o especialmente f√°ceis de importar.
O seguinte m√≥dulo ECMAScript 6 "√©" uma √∫nica fun√ß√£o:
