Objetos Promessas
O objeto Promise √© usado para c√°lculos que s√£o adiados (demorados, retardados) e ass√≠ncronos.
Uma Promessa representa uma opera√ß√£o que ainda n√£o foi conclu√≠da, mas que est√° prevista para o futuro.
A cria√ß√£o de uma nova Promessa define-a automaticamente como estado pendente.
Estados de uma Promise
Internamente, uma promessa pode estar em um de tr√™s estados:

Pendente, quando o valor final ainda n√£o est√° dispon√≠vel
Cumprida, quando e se o valor final se torna dispon√≠vel. Um valor de cumprimento se torna permanentemente associado √† promessa. Isso pode ser qualquer valor, incluindo undefined.
Rejeitado, se um erro impediu que o valor final fosse determinado. Isso pode ser qualquer valor, incluindo undefined, embora geralmente seja um objeto de Erro, como no tratamento de exce√ß√µes.

Criando Promessas
A fun√ß√£o construtora da Promise assume uma fun√ß√£o an√¥nima com 2 argumentos conhecidos como manipuladores (resolver, rejeitar)
