O bloco catch() trata exce√ß√µes e erros
Promise.resolve('oops, esse n√£o √© o json para ser parseado')
  .then(data => JSON.parse(data)) // Tentativa de parsear um arquivo que n√£o √© JSON nos leva pa o bloco catch
  .catch(error => alert(`Error: ${error.message}`)); // Erro √© alertado

Encadeamento de Promises
O m√©todo then() retorna uma promessa, ent√£o pode ser encadeado novamente em outro then()
someFunction.somePromiseReturned()
  .then(getFiles)
  .then(generateIndex)
  .then(generatePosts);

Usando Promessas para requisi√ß√µes Ajax (Promisifying XMLHttpRequest)
function get(url) {
  return new Promise(function(resolve, reject) {
    let req = new XMLHttpRequest();
    req.open('GET', url);

    req.onload = function() {
      // Isso √© chamado mesmo com 404, ent√£o verifique o status
      if (req.status == 200) {
